import React from 'react'
import { Page, Text, View, Document, StyleSheet, ReactPDF, PDFDownloadLink } from '@react-pdf/renderer';
import { Button, Table, Tabs } from 'antd';
import html2canvas from 'html2canvas'
import jsPDF from 'jspdf'
import Svgexporttest from './Svgexporttest';

const columns = [
    {
        title: 'Full Name',
        width: 100,
        dataIndex: 'name',
        key: 'name',
        fixed: 'left',
    },
    {
        title: 'Age',
        width: 100,
        dataIndex: 'age',
        key: 'age',
        fixed: 'left',
    },
    {
        title: 'Column 1',
        dataIndex: 'address',
        key: '1',
        width: 150,
    },
    {
        title: 'Column 2',
        dataIndex: 'address',
        key: '2',
        width: 150,
    },
    {
        title: 'Column 3',
        dataIndex: 'address',
        key: '3',
        width: 150,
    },
    {
        title: 'Column 4',
        dataIndex: 'address',
        key: '4',
        width: 150,
    },
    {
        title: 'Column 5',
        dataIndex: 'address',
        key: '5',
        width: 150,
    },
    {
        title: 'Column 6',
        dataIndex: 'address',
        key: '6',
        width: 150,
    },
    {
        title: 'Column 7',
        dataIndex: 'address',
        key: '7',
        width: 150,
    },
    { title: 'Column 8', dataIndex: 'address', key: '8' },
    {
        title: 'Action',
        key: 'operation',
        fixed: 'right',
        width: 100,
        render: () => <a>action</a>,
    },
];

const data = [];
for (let i = 0; i < 100; i++) {
    data.push({
        key: i,
        name: `Edrward ${i}`,
        age: 32,
        address: `London Park no. ${i}`,
    });
}

const Testpage1 = () => {

    const styles = StyleSheet.create({
        page: { flexDirection: "column", padding: 25 },
        table: {
          fontSize: 10,
          width: 550,
          display: "flex",
          flexDirection: "column",
          justifyContent: "flex-start",
          alignContent: "stretch",
          flexWrap: "nowrap",
          alignItems: "stretch"
        },
        row: {
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
          alignContent: "stretch",
          flexWrap: "nowrap",
          alignItems: "stretch",
          flexGrow: 0,
          flexShrink: 0,
          flexBasis: 35
        },
        cell: {
          borderColor: "#cc0000",
          borderStyle: "solid",
          borderWidth: 2,
          flexGrow: 1,
          flexShrink: 1,
          flexBasis: "auto",
          alignSelf: "stretch"
        },
        header: {
          backgroundColor: "#eee"
        },
        headerText: {
          fontSize: 11,
          fontWeight: 1200,
          color: "#1a245c",
          margin: 8
        },
        tableText: {
          margin: 10,
          fontSize: 10,
          color: '#fcba03'
        }
      });
      

    // Create Document Component
    const MyDocument = () => (
        <Document>
            <Page style={styles.page} size="A4" wrap>
                <View style={styles.table}>
                    <View style={[styles.row, styles.header]}>
                        <Text style={[styles.headerText, styles.cell]}>Column 1 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 2 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 3 Header</Text>
                        <Text style={[styles.headerText, styles.cell]}>Column 4 Header</Text>
                    </View>

                </View>
            </Page>
        </Document>
    );

    const GenerateTablePDF = (Datalist) => {

        for (let i = 0; i < 24; i++) {

        }

        <React.Fragment>

        </React.Fragment>
    }

    const Tablechild = (Datalist) => {



    }


    const convertCanvas = () => {
        const input = document.getElementById("capture");

        html2canvas(input, { scale: 6 })
            .then((canvas) => {
                const imgData = canvas.toDataURL("image/jpeg");
                const pdf = new jsPDF({
                    orientation: 'landscape',
                    type: 'a4'
                });
                //const imgProps = pdf.getImageProperties(imgData);
                const pdfWidth = pdf.internal.pageSize.getWidth();
                const pdfHeight = pdf.internal.pageSize.getHeight();
                pdf.addImage(imgData, 'SVG', 0, 0, pdfWidth, pdfHeight);
                pdf.save('download.pdf');
            });
    }


    return (
        <div>
            {/* <Button onClick={MyDocument}>
                capture
            </Button> */}
            {/* 
            <div id='capture' style={{ width: '100%', height: 600, borderRadius: 15, }}>
            </div> */}
            <div>
                <MyDocument />

            </div>

        </div>
    )
}


export default Testpage1
